import React from "react";
import s from "./Dialogs.module.css";
import { NavLink } from "react-router-dom";

const DialogItem = (props) => {
  return (
    <div className={s.dialog + " " + s.active}>
      <NavLink to={"/dialog/" + props.id}>{props.name}</NavLink>
    </div>
  );
};

const Message = (props) => {
  return <div className={s.message}>{props.message}</div>;
};

let dialogsData=[
  {id:1,name:'Anya'},
  {id:2,name:'Vova'},
  {id:3,name:'Misha'},
  {id:4,name:'Dima'},
  {id:5,name:'Grisha'}
]

let messagesData=[
  {id:1,message:'Hi'},
  {id:2,message:'HELLOO'},
  {id:3,message:'MayyyyY'},
  {id:4,message:'byyyyyyyyyyyeee'},
  {id:5,message:'LET ME'}
]

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        <DialogItem name={dialogsData[0].name} id={dialogsData[0].id}></DialogItem>
        <DialogItem name={dialogsData[1].name} id={dialogsData[1].id}></DialogItem>
        <DialogItem name={dialogsData[2].name} id={dialogsData[2].id}></DialogItem>
        <DialogItem name={dialogsData[3].name} id={dialogsData[3].id}></DialogItem>
        <DialogItem name={dialogsData[4].name} id={dialogsData[4].id}></DialogItem>
      </div>
      <div className={s.messages}>
        <Message message={messagesData[0].message}></Message>
        <Message message={messagesData[1].message}></Message>
        <Message message={messagesData[2].message}></Message>
      </div>
    </div>
  );
};

export default Dialogs;
